import React from 'react';
import background from './assets/gravel2.png';
import './App.css';

class App extends React.Component {
  render() {
    function Welcome(){
      return (
       <div className="App">
          <img src={background} className="background-gravel" alt="gravel" />
          <div className="square" alt="square"/>
       </div>
      )
    } 
  }
}
export default App;
